import React, { useEffect, useState } from 'react';
import Header from '../../components/shared/Header';
import { Box, Grid2, TextField } from '@mui/material';
import { useParams } from 'react-router-dom';
import { getMOLsById } from '../../services/api';

const MOLForm = () => {
    const { id } = useParams()
    const [formState, setFormState] = useState({})

    useEffect(() => {
        getMOLsById(setFormState, id)
    }, [id])
    return (
        <>
            <Header heading="Добавить МОЛ" />
            <Box p={3}>
                <Grid2>
                    <TextField value={formState?.фио_мол} name="фио_мол" placeholder='ФИО' />
                    <TextField value={formState?.должность} name="должность" placeholder='Должность' />
                    <TextField value={formState?.название_подразделения} name="название_подразделения" placeholder='Отдел' />
                </Grid2>
            </Box>
        </>
    );
};

export default MOLForm;
